import React from "react";
import { useSelector } from "react-redux";
import PageContainer from "../../components/features/PageContainer/PageContainer";
import Show from "../../components/features/Show/Show";
import "./Home.scss";


const Home = () => {
  const siteInfo = useSelector(store => store.siteInfo.data);
  const user = useSelector(store => store.user.data.user.phone_number)

  return (
    <PageContainer auth={!!user ? "incomplete-registration" : ""}>
      <Show {...siteInfo} />
    </PageContainer>
  );
};

export default Home;
